import React from 'react';
import { element } from 'prop-types';
import { Box } from '@material-ui/core'
import Header from '../header'

const Layout = ({ children }) => (
  <Box>
      <Header />
      {children}
    <Box>Footer</Box>
  </Box>
);

Layout.defaultProps = {};

Layout.propTypes = {
  children: element,
};

export default Layout;
